VALUES ('4305615640020', 'Kaffee Arabica Zartbitter', 'Certified VUIT ziertem Kakao KAFFEE ARAEICA Kakao unterstützt die Dirk Rossmann GmbH nach- Zartbitter-Schokolade mit Kaffee haltigen Kakaoanbau. www.utz.org O Zartbitterschokolade mit Arabica Kaffee Zutaten: Zucker, Kakaomasse, Kakaobutter, 2,75% Arabica Kaffeenibs Emulgator: Lecithine (Sonnenblume); natürliches Vanillearoma. Kakao: 50%, mindestens im Schokoladenanteil. Kann Spuren von Schalenfrüchten, Milch und Gluten enthalten. Czekolada deserowa z posiekanymi ziarnami kawy Arabica Składniki: cukier, miazga kakaowa, tłuszcz kakaowy, ziarna kawy arabskiej 2,75%, emulgator: lecytyny ze słonecznika; naturalny aromat waniliowy. Czekolada deserowa: Masa kakaowa minimum 50%. Może zawierać orzechy, mleko i zboża zawierające gluten. (PL HL Étcsokoládé tört kávébabokkal Összetevők: cukor, kakaómassza, kakaóvaj, 2,75% kávédarabka, emulgeáló- szer: lecitinek (napraforgó), természetes vanília aroma. Kakaó szárazanyag legalább 50% a csokoládé részben. Dióféléket, tejet és glutént tartalmazhat. Hořká čokoláda se sekanými kávovými zrny CZ) Složení: cukr, kakaová hmota, kakaové máslo, 2,75% sekaná kávové zrna, emulgátor: lecitiny (slunečnicové); přírodní vanilkové aroma. Kakaová sušina nejměně 50% v hořké čokoládě. Může obsahovat skořápkové plody, mléko a lepek.', 'https://static.openfoodfacts.org/images/products/430/561/564/0020/front_de.3.400.jpg', '', '', '', '', '', '', '', '', '', '1');

